import React, { Component } from 'react';
import './App.css';

class HowHome extends Component {

    render(){
      return(
        <div className="howhome">
            <div className="howhometitle center">
               "Where do I start?"
            </div>
            <div className="howhomesubtitle">
                The application process at a glance:
            </div>
            <div className="howrow">
                <HowRowColumn num="1" text="test"/>
                <HowRowColumn num="2" text="tests"/>
                <HowRowColumn num="3" text="tests"/>
                <HowRowColumn num="4" text="tests"/>
            </div>
        </div>
      )
    }
  }

export default HowHome

const HowRowColumn = (props) => {
return(
    <div className="howrowcolumn">
    <div className="howrowcolumnnum">
        {props.num}
    </div>
    </div>
)
}
